import Strange from './Strange.jpg'; 
import Kingdom from './kingdom.jpg'; 
import Peack from './peak.jpg'; 


const Dark = require('./dark.jpg'); 
const Sdata = [ 
{
    img:{Dark},
    title:"Netflix Orignal Series",
    name:"Dark",
    link:"https://www.netflix.com/in/title/80100172"
},
{
    img:{Money},
    title:"Netflix Orignal Series",
    name:"Strange",
    link:"https://www.netflix.com/in/title/80100172"
},
{
    img:{Strange},
    title:"Netflix Orignal Series",
    name:"Money",
    link:"https://www.netflix.com/in/title/80100172"
},
{
    img:{Kingdom},
    title:"Netflix Orignal Series",
    name:"The Last Kingdom",
    link:"https://www.netflix.com/in/title/80074249"
},
{
    img:{Peack},
    title:"Netflix Orignal Series",
    name:"Peacky Blinders",
    link:"https://www.netflix.com/in/title/80002479"
},




];



export default Sdata;
